import React, { Component } from 'react'
import '../css/NavBar.css'

class NavBar extends Component {
  render () {
    return (
      <div id='NavBar'>
      <h3>Bible Phrasing</h3>
        <ul>
          <li>Present</li>
        </ul>
      </div>
    )
  }
}

export default NavBar
